(function($) {
    $(window).resize(resizeNav);
    $(window).load(resizeNav);

    $(document).ready(function(){
        $("#search-field").click(function(){
            $(this).siblings("#geneseo-custom-search-wrapper").toggle('fast');
            $(this).children("#search-close-icon").toggle();
            $(this).children("#search-icon").toggle();
        });
    });
    
    function resizeNav() {
        var collapseMenu = $("#collapse-menu");
        var collapseIcon = $("#more-button");
        if ($(window).width() > 1024) {
            var nav = $("#geneseo-main-nav-right");
            var navParent = nav.parent();
            checkNavigation(nav, navParent, collapseMenu, collapseIcon, false);
        }
        else {
            collapseMenu.hide();
            collapseIcon.hide();
        }
    }
    
    function checkNavigation(nav, navParent, collapseMenu, collapseIcon, previousAction) {
        navWidth = 0;
        nav.children('a').each(function(){
            navWidth += $(this).outerWidth();
        });
        if (collapseMenu.children('li').length == 0) {
                collapseMenu.hide();
                collapseIcon.hide();
        }
                
        if (navWidth > navParent.width()) {
            if (nav.children('a:nth-last-of-type(3)')) {
                collapseMenu.show();
                collapseIcon.show();
                moveToCollapse(nav.children('a:nth-last-of-type(3)'), collapseMenu);
                checkNavigation(nav, navParent, collapseMenu, collapseIcon, true);
            }
        }
        else {
            if (!previousAction && collapseMenu.children('li').length) {
                if (moveToExpand(collapseMenu.children('li').last(), nav, navParent, navWidth)) {
                    checkNavigation(nav, navParent, collapseMenu, collapseIcon, true);
                }
            }
        }
    }
    
    function moveToCollapse(linkObj, collapseMenu) {
        linkObj.removeClass('mdl-navigation__link');
        linkObj.removeClass('mdl-typography--text-uppercase');
        var linkHTML = linkObj.wrap('<div />').parent().html();
        linkObj.parent().remove();
        collapseMenu.append('<li class="mdl-menu__item mdl-js-ripple-effect">' + linkHTML + '</li>');
    }
    
    function moveToExpand(linkObj, nav, navParent, navWidth) {
        nav.children('a:nth-last-of-type(3)').after(linkObj.html());
        nav.children('a:nth-last-of-type(3)').addClass('mdl-navigation__link');
        nav.children('a:nth-last-of-type(3)').addClass('mdl-typography--text-uppercase');
        //Check to make sure all can fit.
        if ((navWidth + nav.children('a:nth-last-of-type(3)').width()) > navParent.width()) {
            nav.children('a:nth-last-of-type(3)').remove();
            return false;
        }
        else {
            linkObj.remove();
            return true;
        }
    }
})(jQuery);;
