(function ($) {
  var hasRightNav = false;
  $(document).ready(function() {
    $(".geneseo-slideshow").each(function() {
      $(this).find("ul").first().addClass("slides");
      $(this).flexslider({
        animation: "slide"
      });
    });

    $('.primary-tabs a:not([href^="#"])').click(function(){
      $("#content").find(".field-name-body").first().replaceWith('<div class="mdl-spinner mdl-js-spinner is-active"></div>');
      window.location.href = $(this).attr("href");
    });
    $(".geneseo-dept-reveal").click(function(event) {
      event.preventDefault();
      $(this).next(".geneseo-dept-links").toggle("fast");
      $(this).find(".geneseo-expand-more").toggle();
      $(this).find(".geneseo-expand-less").toggle();
    });
    if ($(".geneseo-right-nav").length) {
      hasRightNav = true;
    }
    onReadyResize();
  });

  var hasHeader = false;
  var disableHeader = true;
  $(window).load(function(){

    if ($(".geneseo-landing-page-wrapper").length) {
      hasHeader = true;
    }
    
    if ($(".geneseo-left-nav").length) {
      $(".geneseo-left-nav").children("section").first().css("margin-top", "8px");
    }

    onLoadAndResize();
    onLoadResizeAndScroll();
  });
  $(window).resize(function() {
    onLoadAndResize();
    onLoadResizeAndScroll();
    onReadyResize();
  });

  $(window).scroll(function() {
    onLoadResizeAndScroll();
  });

  function calculateBodyShowing() {
    var topHeight = $(".geneseo-header").first().height()
    if ($("#admin-menu").length) {
      topHeight += $("#admin-menu").length;
    }
    
    var bannerSize = 0;
    if (hasHeader) {
      bannerSize = $(".geneseo-landing-page-wrapper").first().height();
    }
    var contentShowing =  $(window).height() + $(window).scrollTop() - bannerSize - topHeight;

    //If there is a banner then it is making the content area smaller
    if ($(document).scrollTop() >= bannerSize) {
      contentShowing = $(window).height() - topHeight;
    }
    //If the footer is showing then it is making the content area smaller
    if ($(window).scrollTop() > $(document).height() - $(window).height() - $(".geneseo-footer").first().height() ) {
      //Subtract the amount that the footer is showing from the content area size
     contentShowing = contentShowing - ($(window).scrollTop() - ($(document).height() - $(window).height() - $(".geneseo-footer").first().height()));
    }

    return contentShowing;
  }

  function onLoadResizeAndScroll() {
    var headerHeight = $(".geneseo-header").first().height();
    var contentShowing = calculateBodyShowing();
    
    if ($("#admin-menu").length) {
      headerHeight += $("#admin-menu").height();
    } 
    
    var landingHeaderHeight = $(".geneseo-landing-page-wrapper").first().height();
    /*if ($(".geneseo-left-nav").length){
      if ($(".geneseo-left-nav")[0].scrollHeight + 32 >= contentShowing) {
        $(".geneseo-left-nav").first().css("height", (contentShowing - 32) + "px");
        $(".geneseo-left-nav").first().css("overflow-y", "scroll");
      }
      else {
        $(".geneseo-left-nav").first().css("height", "initial");
        $(".geneseo-left-nav").first().css("overflow", "initial");
      }
    }*/

    if (hasHeader) {
      if ($(document).scrollTop() >= landingHeaderHeight) {
        //image is above the fold  
        //$(".geneseo-left-nav").css("top", headerHeight + 16);
        $(".geneseo-right-nav").css("top", headerHeight + 16);
      }
      else {
        /*$(".geneseo-left-nav").first().css("height", "initial");
        $(".geneseo-left-nav").first().css("overflow", "initial");
        $(".geneseo-left-nav").css("top", headerHeight + (-1 * $(document).scrollTop()) + landingHeaderHeight + 16);*/
        $(".geneseo-right-nav").css("top", headerHeight + (-1 * $(document).scrollTop()) + landingHeaderHeight + 16);
      }
    }
    else { 
      $(".geneseo-right-nav").css("top", headerHeight + 16);
    }
  }

  function onLoadAndResize() {
    // Set content margin
    if (hasHeader) {
     
      var img = $(".geneseo-landing-page-wrapper").first();
      img.css("height", "auto");
      img.css("width", "100%");
      img.css("background-position-y", $(".geneseo-header").first().height() + "px");
      //img.css("transform", "translateX(0px)");
      if (img.height() != $(window).height()/2) {
        img.css("height", $(window).height()/2);
        img.css("width", "auto");
        //img.css("transform", "translateX(" + (-1 * (img.width() - $(window).width())/2) + "px)");
        if (img.width() < $(window).width()) {
          img.css("height", "auto");
          img.css("width", "100%");
          //img.css("transform", "translateX(0px)");
        }
      }
    }
    $(".breadcrumb").css("margin-top", "0");
    if ($(window).width() < 840) {
      $(".android-content").css("margin-top", $(".geneseo-header .mdl-layout__header-row").first().height());
      $("#content").css("margin-top", $(".geneseo-right-nav").first().height());
      if (hasRightNav) {
        $(".breadcrumb").css("margin-top", "16px");
      }
    }
    else {
      $("#content").css("margin-top", 24);
      $(".android-content").css("margin-top", $(".geneseo-header").first().height());
    }
      $(".geneseo-left-nav").first().width($(".geneseo-left-nav").first().parent().width());
      $(".geneseo-right-nav").first().width($(".geneseo-right-nav").first().parent().width());

    //Needs to get moved to its own JS file
    $(".faculty-card").css("height", "auto");
    var maxHeight = 0;
    $(".faculty-card").each(function() {
      if ($(this).height() > maxHeight) {
        maxHeight = $(this).height();
      }
    });
    $(".faculty-card").height(maxHeight);
  }
  
  function onReadyResize() {
    if ($(window).width() > 1150) {
      $(".leftSideContent").removeClass("mdl-cell--3-col-desktop");
      $(".leftSideContent").addClass("mdl-cell--2-col-desktop");
      if (hasRightNav) {
        $("#content").removeClass("mdl-cell--7-col-desktop");
        $("#content").addClass("mdl-cell--8-col-desktop");
      }
      else {
        $("#content").removeClass("mdl-cell--9-col-desktop");
        $("#content").addClass("mdl-cell--10-col-desktop");
      }
    }
    else {
      $(".leftSideContent").removeClass("mdl-cell--2-col-desktop");
      $(".leftSideContent").addClass("mdl-cell--3-col-desktop");
      if (hasRightNav) {
        $("#content").removeClass("mdl-cell--8-col-desktop");
        $("#content").addClass("mdl-cell--7-col-desktop");        
      }
      else {
        $("#content").removeClass("mdl-cell--10-col-desktop");
        $("#content").addClass("mdl-cell--9-col-desktop");        
      }
    }
  }


})(jQuery);
